    /// @dev 将数字存储在状态变量 storedData 中
    function set(uint256 _x) public{
        storedData = _x;
    } 
    // get 
    /// @notice 返回存储的值
    /// @return 储存值 ，对函数返回变量的描述
    /// @dev 检索状态变量 storedData 的值
    function get() public view returns(uint256) {
        return storedData;
    }

    /*
     * @notice 第二种写法
     * @param _x: storedData 将要修改的值
     * @dev 检索状态变量 storedData 的值
     */
}

